import {View,Text} from 'react-native';

import CountChange from 'CountChange';

 const App = () => {
     return (
         <View style={{flex:1}}>
             <Text style={{textAlign:'center',fontSize:40}}>StackDemo</Text>
             <CountChange/>
         </View>

     )
 }
export default App
